import React, { Suspense } from 'react';
import { createBrowserRouter, RouteObject, RouterProvider } from "react-router-dom";
import SignInEmail from "./modules/sign-in/pages/SignInEmail";

function App() {

    const routes: RouteObject[] = [
        {
            path: "/sign-in",
            element: <SignInEmail />,
            errorElement: <div>something unexpected happened</div>,
        },
        {
            path: "/sign-in",
            element: <SignInView />,
            errorElement: <div>something unexpected happened</div>, // todo add from d-c

        },
        {
            path: "/sign-in/activate",
            element: <SignUpView />,
            errorElement: <div>future error page from direct components</div>, // todo add from d-c
        },
        {
            path: "/sign-in/confirm",
            element: <ConfirmView />,
            errorElement: <div>future error page from direct components</div>, // todo add from d-c
        },
    ];

    const router = createBrowserRouter(routes);

  return (
    <Suspense fallback={<div>future loader</div>}>
      <RouterProvider router={router} />
    </Suspense>
  );
}

export default App;
